import { withRouter } from 'next/router';

export default function Navbar() {
    return (
        <>
            <div>
                <nav>
                    <a>Objection</a>
                    <a>Account</a>
                    <a>World</a>
                    <a>Tech</a>
                    <a>Sports</a>
                </nav>
            </div>
            <style jsx>{`
                div {
                    position: relative;
                    z-index: 1;
                    left: 0;
                    box-sizing: border-box;
                    width: 100%;
                    height: 55px;
                    font-family: Verdana, sans-serif;
                    font-size: 20px;
                    padding: 14px 16px;
                    box-shadow: 0px 4px 4px 0px #ddd;
                }

                a {
                    padding-right: 100px;
                }

                a:hover {
                    color: #111;
                }
            `}</style>
        </>
    );
}
